.section-home__menu a:hover {
  cursor: pointer;
  position: relative;
  z-index: 1;
}
.section-home__menu a:after {
  display: block;
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0;
  margin: auto;
  width: 100%;
  height: 5px;
  content: ".";
  color: transparent;
  background: #000;
  visibility: none;
  opacity: 0;
  z-index: -1;
}
.section-home__menu a:hover:after {
  opacity: 0.2;
  visibility: visible;
  height: 100%;
}
.section-home__menu a,
.section-home__menu a:after,
.section-home__menu a:before {
  -webkit-transition: all 0.2s;
  transition: all 0.2s;
}
